import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import './index.css'
import ThePeople from './test.jsx';
import contact from './contacts'
import * as cal from './Heading'

function createCard(contact) {
  return 
    <cal.default 
    id = {contact.id}
    name = {contact.name}
    tel = {contact.tel}
    email = {contact.email} />
    
}

function App() {
  const [items, setItems] = useState([]);
  return 
  {contact.map(createCard)}
  
 }


 
export default App;
